tests.code:
cy.visit(`${input.url}`);
_youtubeHomePage.default.getLangYoutube().then(langAttr => {
  cy.log(`Language Default : ${langAttr}`);
  lang = langAttr === "id-ID" ? "id" : "en";
});
cy.then(() => {
  _youtubeHomePage.default.goToTrendingMenu(input[lang].explore);
  _youtubeHomePage.default.goToMoviesTab(input[lang].movie);
  // Get Judul Film
  _youtubeTrendingPage.default.getJudulFilm().then(judul => {
    judulFilm = judul;
  });
  // Get Channel
  _youtubeTrendingPage.default.getChannelYoutube().then(src => {
    channel = src;
  });
  cy.then(() => {
    cy.log(`Judul Film : ${judulFilm}`);
    cy.log(`Channel Name : ${channel}`);
    _youtubeTrendingPage.default.clickMovies();
    cy.wait(10000);
    _youtubeVideoPage.default.getMovieTitle(judulFilm);
    _youtubeVideoPage.default.getMovieChannel(channel);
    _youtubeVideoPage.default.clickShareAndCopy(input[lang].share);
    _youtubeVideoPage.default.getLinkUrl().then(link => {
      cy.log(`Link Url : ${link}`);
    });
  });
});
